import React, {Component} from 'react';
import Navbar from './Navbar.js';

class App extends Component {

    constructor(props) {
        super(props)
    }

    render() {
        return (
            <div>
                <Navbar />
                <div className='text-center'>
                    <p></p>
                </div>
            </div>
        )
    }
}

export default App;
